  [],\n\t\"num_tags\": 0,\n\t\"name\": \"afsc-nmml-known-human-caused-marine-mammal-injury-and-mortalities-from-2007-to-present\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Marine Fisheries Service (NMFS)
  is required under the MMPA to estimate the annual human-caused mortality and serious
  injury of marine mammal stocks by source. Data from documented interactions between
  humans and Alaska pinnipeds and cetaceans under the jurisdiction of the NMFS are
  compiled in this data set and details regarding each human/marine mammal interaction
  are reviewed for evidence of human-caused injury or mortality.  Criteria are applied
  in order to assign injuries to categories and determine the severity (serious or
  non-serious). Injury determination details regarding the injury source, type, and
  severity are included, along with the injury category and criteria supporting the
  determination. Mortality and injury values are assigned (0, 1, or prorated) to each
  event for comparison with the calculated Potential Biological Removal levels for
  each stock.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
